# remove all points that are one standard deviation away
def modify(x_values, y_values, param):
  std_dev = np.std(y_values)
  mean = np.mean(y_values)
  median = np.median(y_values)
  #if (mean < median + param*std_dev or mean > median - param*std_dev): #use mean instead of median
   # median = mean
  new_x = np.array([])
  new_y = np.array([])

  for i in range(len(y_values)):
    if not(y_values[i] > median + param*std_dev or y_values[i] < median - param*std_dev):
      new_x = np.append(new_x, x_values[i] )
      new_y = np.append(new_y, y_values[i])

    
    
  return new_x,new_y
    
  
  

